import React, { Component } from "react";
//style importer
import * as s__ from "./style";

import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import DashboardIcon from '@material-ui/icons/Dashboard';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';


import List from '@material-ui/core/List';
//import component
import NewsCard from '../CardNews/index';
import { Route, Link } from "react-router-dom";

class MenuManager extends Component<{}, {}> {
  renderPatientManager=()=>{
    return (
      <List>
        <ListItem button>
          <ListItemIcon>
            <DashboardIcon />
          </ListItemIcon>
          <Link to="/manager/info/room"><ListItemText disableTypography={true} primary="Rooms" /></Link>
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <ShoppingCartIcon />
          </ListItemIcon>
          <Link to="/manager/info/shift"><ListItemText primary="Shifts" /></Link>
        </ListItem>
        <ListItem button>
          <ListItemIcon>
            <ShoppingCartIcon />
          </ListItemIcon>
          <Link to="/manager/info/patient"><ListItemText primary="Patients" /></Link>
        </ListItem>
      </List>
    )
  }

  render() {
    return  (
      <s__.Container>
        {this.renderPatientManager()}
      </s__.Container>
    )
  }
}

export default MenuManager;
